    ls['BOHB'] = [[], [], [], []]
    ls['Optunity'] = [[], [], [], []]
    ls['hyperopt'] = [[], [], [], []]
    ls['RoBo gp'] = [[], [], [], []]
    ls['BTB'] = [[], [], [], []]

    for idx, task in enumerate(tasks):
        bm = OpenMLBenchmark(task, load=False)

        d = {}
        inc = {}
        results = persistence.load_all(bm)
        for res in results:
            for solver in res.solvers:
                tmp = solver.as_numpy()[1]
                d.setdefault(solver.algorithm, []).append(1 - tmp[last_iteration])
                inc.setdefault(solver.algorithm, []).append(tmp[offset:iterations + offset])
                assert np.isclose(tmp[-1], solver.score)

        if len(d.keys()) == 0:
            print('{}: No data!'.format(task))
            for key in ls.keys():
                ls[key][0].append(minimum[idx])
                ls[key][1].append(0)
                ls[key][2].append(np.ones(iterations) * minimum[idx])
            continue

        assert d.keys() == ls.keys()
        for key, value in d.items():
            x = np.array(value)
            if len(value) < 10:
                print('{}:\t\t{}'.format(key, len(value)))

            ls[key][0].append(x.mean())
            ls[key][1].append(x.std())
            ls[key][2].append(np.array(inc[key]).mean(axis=0))
            ls[key][3].append([1 - v for v in value])

    # Print raw results
    print('#####\nRaw CASH Framework Results\n#####')
    labels = ls.keys()

    average = []
    average_std = []
    for idx in np.argsort(datasets):
        mean = []
        std = []

        # Add baseline methods
        mean.append(minimum[idx])
        mean.append(maximum[idx])
        std.append(0)
        std.append(0)

        for key in labels:
            mean.append(ls[key][0][idx])
            std.append(ls[key][1][idx])

        average.append(mean)
        average_std.append(std)

        highest = np.max(mean)
        print(datasets[idx], '\t&\t', end='')
        for i in range(len(mean)):
            if mean[i] == highest:
                print('\\B ', end='')
            print('{:.4f}'.format(mean[i]).zfill(4), end=' ')
            # print('\\(\\pm\\)', '{:.3f}'.format(std[i]).zfill(4), end='')
            if i == len(mean) - 1:
                print('\t\\\\')
            else:
                print('\t&\t', end='')

    print('\\\\\nAverage & ', end='')
    average = np.array(average)
    average_std = np.array(average_std)
    tmp = np.zeros((2, average.shape[1]))
    for i in range(average.shape[1]):
        tmp[0][i] = average[:, i].mean()
        tmp[1][i] = average_std[:, i].mean()

    highest = np.max(tmp[0, :])
    for i in range(tmp.shape[1]):
        if tmp[0][i] == highest:
            print('\\B ', end='')
        print('{:.4f}'.format(tmp[0][i]).zfill(5), end=' ')
        # print('\\(\\pm\\)', '{:.3f}'.format(tmp[1][i]).zfill(5), end='')
        if i == tmp.shape[1] - 1:
            print('\t\\\\')
        else:
            print('\t&\t', end='')
    print('\n\n\n')

    results = [v[3] for v in ls.values()]

    # Normalize values. Use precision to have higher value => better result
    max_tile = np.tile(maximum, (iterations, 1)).T
    min_tile = np.tile(minimum, (iterations, 1)).T

    normalized = []
    incumbents = []
    for key in labels:
        x = np.array(ls[key][0])
        n = (x - minimum) / (maximum - minimum)
        normalized.append(n)

        x2 = 1 - np.array(ls[key][2])
        n2 = (x2 - min_tile) / (max_tile - min_tile)
        incumbents.append(n2)

    normalized = np.array(normalized)
    incumbents = np.array(incumbents)
    plot_cash_incumbent(incumbents, list(labels))
    plot_pairwise_performance(average[:, 3:], list(labels)[1:], cash=True)
    plot_overall_performance(normalized.T, list(labels), cash=True,
                             # colors=['b', 'g', 'r', 'c', 'm', 'pink', 'lawngreen']
                             )
    plot_dataset_performance(results, minimum, maximum, list(labels), tasks, cash=True)


